edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/xeno_effect_audio_track.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message XenoEffectOutputAudioConfig {
	XenoEffectAudioTrack canonical_output_track = 1;
	repeated XenoEffectAudioTrack auxiliary_output_track = 2;
}
